import React, { Component } from "react";

class Recipe extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div>
        <h1>{this.props.title}</h1>
        <p>{this.props.calories}</p>
        <img src={this.props.image} alt="" />
      </div>
    );
  }
}
export default Recipe;
